				"title": "Steam Mephit",
				"text": "<p>When a character pours a pint or more of water into the statue&rsquo;s right hand or one of its cupped feet, the liquid sizzles and transforms into 1d3&nbsp;<a class=\"tooltip-hover monster-tooltip\" href=\"https://www.dndbeyond.com/monsters/17022-steam-mephit\" data-tooltip-href=\"//www.dndbeyond.com/monsters/17022-tooltip?disable-webm=1&amp;disable-webm=1\">steam mephits</a>&nbsp;that fight until destroyed. The statue can create up to six steam mephits in this fashion, after which no more mephits can be created until the next dawn. A steam mephit reduced to 0 hit points loses its form and disappears.</p>",
				"plain": "When a character pours a pint or more of water into the statue’s right hand or one of its cupped feet, the liquid sizzles and transforms into 1d3 steam mephits that fight until destroyed. The statue can create up to six steam mephits in this fashion, after which no more mephits can be created until the next dawn. A steam mephit reduced to 0 hit points loses its form and disappears.",
